  \"health-and-maintenance-status-determination-and-predictive-fault-diagnosis-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The objective of this project is to demonstrate
  intelligent health and maintenance status determination and predictive fault diagnosis
  techniques for NASA rocket engines under online and offline conditions from either
  on-board or maintenance, test and analytic data. AGNC proposes a Health and Maintenance
  Status Determination and Predictive Fault Diagnosis System (HMSD/PFDS). The fuzzy
  qualitative model for model-based residual generation and the rule-based evaluation
  of residuals using neural-fuzzy combination are defined. Intelligent data fusion
  strategies for health and maintenance determination and predictive fault diagnosis
  are developed for rocket engine systems/subsystems. The goal is to ensure safety,
  cost reduction, graceful degradation and re-optimization in the case of failures,
  malfunctions and damages. Kalman filter based and rule based evaluation of residuals
  using neural-fuzzy combination are developed. The use of fuzzy qualitative models
  takes into account the uncertainties associated with behavior descriptions and incorporates
  available expert failure symptom knowledge to recognize the particular failure features.
  Actual or simulated rocket engine sensed or derived data are utilized to evaluate
  the effectiveness of the health and maintenance determination and fault prognosis
  approaches for NASA platforms. Phase I is devoted to the HMSD/PFDS design and simulation.
  Phase II will result in development of a functional prototype.\",\n\t\"license_title\":
